import React from 'react';
import { Jumbotron as Jumbo, Container } from 'react-bootstrap';
import styled from 'styled-components';

const Styles = styled.div`
  .jumbo {
    display: inline-block;
    margin: 2.5vh 2.5vw 2.5vh 2.5vh;
    padding: 4vw 2vw 4vw 2vw;
    height: 10vh;
    display: flex;
    align-items: center;
    background-color: white;
    width: 40vw;
  }

  #about {
    border: solid #8cc4ec 1px;
    color: #8cc4ec;
  }

  #experiences {
    background-color: #EAAFAF;
  }

  p {
    margin: 0px;
    font-size: 2rem;
  }
`

export const AboutJumbotron = () => (
  <Styles>
    <Jumbo fluid id="about" className="jumbo">
      <Container>
        <p>About</p>
      </Container>
    </Jumbo>
  </Styles>
)

export const ExperiencesJumbotron = () => (
  <Styles>
    <Jumbo fluid id="experiences" className="jumbo">
      <Container>
        <h1>Experiences</h1>
      </Container>
    </Jumbo>
  </Styles>
)
